@Thiago As vezes fico pensando? 洟
_ Serﾃ｡ que que ﾃｩ verdade tudo isto que estﾃ｡ acontecendo? Serﾃ｡  que ﾃｩ verdade que um dos mais importantes ministﾃｩrio estﾃ｡ sendo ministrado por uma louca, insana, falsa?
Serﾃ｡ que todos os militares de todas as forﾃｧas armadas do paﾃｭs nﾃ｣o se lembram do que este presidente fez qdo serviu o exﾃｩrcito? Nﾃ｣o vﾃｪm que ele ﾃｩ um mal exemplo para os militares? Serﾃ｡  que este presidente  que derruba todas as formas de educaﾃｧﾃ｣o, respeito, dignidade, liberdade, formalidade, diplomacia ainda estﾃ｡ lﾃ｡  diserminando ﾃｳdio, desrespeito a tudo e a todos? Ninguﾃｩm vﾃｪ, ninguﾃｩm faz nada... Nosso paﾃｭs ﾃｩ tﾃ｣o maravilhoso, e ninguﾃｩm percebe que  este homem estﾃ｡ acabando com tudo, colocando uns contra os outros?  Um presidente que se diz cristﾃ｣o e zela pelas familias, mas maltrata mulheres, vende armas, desrespeita religiﾃｵes e povos. Transformou nossa bandeira linda que representava tantas coisas maravilhosas de nosso paﾃｭs  em uma bandeira medo, atﾃｩ mesmo de um certo nojo. Estou muito indignada e cansada de ver tanta coisa errada, de ver nosso paﾃｭs sendo ridicularizado perante o mundo todo. Estou triste e envergonhada, vergonha alheia por ter este homem como presidente de um paﾃｭs abenﾃｧoado por Deus como este nosso Brasil
